                      text: "“When packing for Mardi Gras, it’s important that you just start with the essentials,” says presenter, writer, podcaster and creator @louishanson (Louis Hanson). And those essentials are...? “My six wigs.” 🌈 ⁣\n ⁣\nIt’s the final weekend of Sydney Mardi Gras, and Louis is taking us along for his packing journey. While the weekend will be filled with colorful parades and parties, the celebrations really represent an especially meaningful moment for the LGBTQ+ community in Australia. ⁣\n ⁣\n“Most important, it’s just about taking to the streets, showing up, being visible and being proud of who you are,” says Louis. ⁣\n ⁣\nVideo of @louishanson by @jesseleaman_",
