                      text: "“I love surfing — being in the ocean and having a connection with nature. It’s one of the most beautiful things in life.” —Pro surfer @riowaida_ (Rio Waida) ⁣\n ⁣\nRio grew up in a surfer’s paradise: Bali, Indonesia. “I feel like Indonesia has the most perfect waves in the world, period. Every wave I ride makes me happy. But I’m a very competitive guy, so that’s why I take surfing seriously.” ⁣\n ⁣\nRio’s passion for surfing has taken him all the way to the Tokyo 2020 Olympics — and now he’s focused on qualifying for Paris 2024. “I want to become world champion and pick up a gold medal at the Olympics. That’s a very big mountain to climb, but everything is possible if you keep chasing and keep working hard.” ⁣\n ⁣\n@riowaida_ is one of 24 young, unique, difference-makers and catalysts we love who is sparking the cultural zeitgeist. #24for24 🌊 ⁣\n ⁣\nPhotos of @riowaida_ by @raw._clip and @georgeswims",
